import {} from '@expo/vector-icons';
import React from 'react';
import {View, Text, Image, TouchableOpacity, Pressable, } from 'react-native';
import { ScrollView } from 'react-native-gesture-handler';

export default function SignUp({navigation}) {
    return (
    <View style={{flex: 1,justifyContent:"center", alignItems:"center", borderBottomLeftRadius: 60,borderBottomLeftRadius: 60,borderBottomLeftRadius: 60,borderBottomLeftRadius: 60,borderBottomLeftRadius: 60,borderBottomLeftRadius: 60,borderBottomLeftRadius: 60, backgroundColor:"white"}}>
        <Image 
            style={{
                width: 415,
                height: 260,
                marginTop: -10,
                borderBottomLeftRadius: 60,
                backgroundColor: '#e6e6fa',
            }}
            source={{
                uri:"https://images.unsplash.com/photo-1605497788044-5a32c7078486?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxzZWFyY2h8NXx8c2Fsb29ufGVufDB8fDB8fA%3D%3D&auto=format&fit=crop&w=500&q=60"}}/>
        <View style={{borderBottomLeftRadius: 60,marginBottom: 10, marginTop: 40,marginRight: 200,}}>
        <Text style={{ color:"black", paddingBottom:20, fontSize: 30, fontWeight:'600'}}>Sign-Up</Text>
        <Text style={{ paddingTop:10, color: "rgba(0,0,0,0.6)", fontSize:18,}}>First Name</Text>
            <Pressable style={{
            backgroundColor: '#e6e6fa',   
            padding: 25, 
            paddingHorizontal: 170,     
            marginRight: -180,
            flexDirection: 'row',
            alignItem: 'center',
            borderRadius: 10, 
            marginTop: 10, 
            }}></Pressable>
            
        <Text style={{paddingTop:20,color:"rgba(0,0,0,0.6)", fontSize:18,}}>Last Name</Text>
            <Pressable style={{
            backgroundColor: '#e6e6fa',   
            padding: 25, 
            paddingHorizontal: 170,     
            marginRight: -180,
            flexDirection: 'row',
            alignItem: 'center',
            borderRadius: 10, 
            marginTop: 10, 
            }}></Pressable>

        <Text style={{paddingTop:20,color:"rgba(0,0,0,0.6)", fontSize:18,}}>Email</Text>
            <Pressable style={{
            backgroundColor: '#e6e6fa',   
            padding: 25, 
            paddingHorizontal: 170,     
            marginRight: -180,
            flexDirection: 'row',
            alignItem: 'center',
            borderRadius: 10, 
            marginTop: 10, 
            }}></Pressable>

        <Text style={{paddingTop:20,color:"rgba(0,0,0,0.6)", fontSize:18,}}>Password</Text>
            <Pressable style={{
            backgroundColor: '#e6e6fa',   
            padding: 25, 
            paddingHorizontal: 170,     
            marginRight: -180,
            flexDirection: 'row',
            alignItem: 'center',
            borderRadius: 10, 
            marginTop: 10, 
            }}></Pressable>
        </View>
        <Pressable style={{
            backgroundColor: '#663399',   
            padding: 15, 
            paddingHorizontal: 50,
            flexDirection: 'row',
            alignItem: 'center',
            borderRadius: 15, 
            marginTop: 10, 
            }}>
            <Text style={{ fontSize: 20 }}>SIGN UP</Text>
            </Pressable>
            
            <TouchableOpacity
            onPress={() => {
                navigation.navigate("Login")
              }}
              activeOpacity={0.8}
             style={{
                 flexDirection: "row",
                 padding: 10,  
                 }}>
                    <Text style={{color:"rgba(0,0,0,0.6)", fontSize: 18, padding: 25}}>Already have an account? 
                    <Text style={{color:"#663399"}}>Click here to Login</Text>
            </Text>
            </TouchableOpacity>
    </View>
    );
}
